import React from "react";
import Title from "./Title";

export default function Todo() {
  return (
    <>
      <Title heading={'Todo App'} react={('ReactApp')}/>
      <div className="row mt-4">
        <form className="col-12 d-flex gap-2 justify-content-center">
          <input type="text" className="col-5 col-lg-4" placeholder="Enter your text..."/>
          <input type="Date" className="col-3 col-lg-3"/>
          <button type="submit" className="col-2 col-lg-1">Add</button>
        </form>
      </div>
    </>
  );
}
